import LoginForm from '../Components/Forms/LoginForm';
import AllToDo  from '../Components/ToDo/AllToDo'

export class UserPage extends Component{
    render(){
        return (
            <Fragment>
                <UserNavBar />
                <UserProfile />
                <UserMenu />
